import React from 'react';
import { Layout } from './layout/Layout.js';

function Speaking() {
  return (
    <Layout>
      <div className="text-block-left small">
        <p>
          ðŸŽ¤ I've spoken at a number of different conferences and events over the last few years, including:
        </p>
        <ul>
          <li><a href="">Strange Loop</a> in St. Louis, MO (September 2019)</li>
          <li><a className="inlineLink" href="https://www.youtube.com/watch?v=34tLTZgvOxM&list=PLBzScQzZ83I8aBUZtZXNWZkWKEgWRffH6&index=12&t=0s&app=desktop">How to Get Away with Refactoring</a> at <strong>Lead Dev Austin</strong> (December 2018)</li>
          <li><a className="inlineLink"  href="https://conferences.oreilly.com/velocity/vl-ny/public/schedule/speaker/305220.html">How to Get Away with Refactoring</a> at <strong>O'Reilly Velocity</strong> (October 2018)</li>
          <li><a href="https://conferences.oreilly.com/velocity/vl-ny/public/schedule/speaker/305220.html">How to Get Away with Refactoring</a> at <strong>O'Reilly Velocity</strong> (October 2018)</li>
        </ul>
      </div>
    </Layout>
  );
}

export default Speaking;
